import React from 'react';
import './App.css';
import Home from "./components/Home"
import About from "./components/About"
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <h1>Sandesh</h1>
        <Route path = "/" component = {Home}/>
        <Route path = "/" component = {About}/> 
      </div>
    </Router>
  );
}

export default App;
